import React from 'react';
import { Link } from 'react-router-dom';
import { ClipboardCheck, Plane, Package, BarChart, Settings, Box, Users, FileText, ShieldCheck } from 'lucide-react';

function HomePage() {
  const features = [
    {
      title: 'Compliance Checker',
      icon: <FileText className="w-6 h-6 text-indigo-600" />,
      description: 'Verify shipment compliance with regulations',
      path: '/clerk',
      color: 'bg-indigo-50 hover:bg-indigo-100 text-indigo-600'
    },
    {
      title: 'Cross-Border Router',
      icon: <Plane className="w-6 h-6 text-teal-600" />,
      description: 'Optimize routes for cost, time and feasibility',
      path: '/route-optimizer',
      color: 'bg-teal-50 hover:bg-teal-100 text-teal-600'
    }
  ];

  const roles = [
    {
      title: 'Clerk',
      icon: <ClipboardCheck className="w-5 h-5" />,
      path: '/clerk',
      color: 'bg-indigo-100 text-indigo-600 hover:bg-indigo-200'
    },
    {
      title: 'Manager',
      icon: <Users className="w-5 h-5" />,
      path: '/dashboard',
      color: 'bg-teal-100 text-teal-600 hover:bg-teal-200'
    },
    {
      title: 'Admin',
      icon: <ShieldCheck className="w-5 h-5" />,
      path: '/admin',
      color: 'bg-amber-100 text-amber-600 hover:bg-amber-200'
    }
  ];

  return (
    <div className="min-h-screen bg-gray-50">
      <header className="max-w-5xl mx-auto px-6 py-6">
        <div className="flex items-center justify-between">
          <div className="flex items-center space-x-2">
            <div className="flex">
              <Box className="w-6 h-6 text-indigo-600" />
              <Plane className="w-6 h-6 text-teal-600 -ml-1" />
            </div>
            <span className="text-xl font-medium text-gray-900">Vership</span>
          </div>
          <nav className="flex space-x-6">
            <a href="#features" className="text-gray-600 hover:text-indigo-600 transition-colors duration-200 text-sm font-medium">Features</a>
            <a href="#roles" className="text-gray-600 hover:text-indigo-600 transition-colors duration-200 text-sm font-medium">Roles</a>
          </nav>
        </div>
      </header>

      <main className="max-w-5xl mx-auto px-6">
        {/* Hero Section */}
        <section className="py-20 text-center">
          <h1 className="text-3xl font-medium text-gray-900 mb-4">
            Global Trade Compliance Made Simple
          </h1>
          <p className="text-lg text-gray-600 mb-20 max-w-2xl mx-auto">
            Automated compliance checks and intelligent routing for cross-border shipments
          </p>
          
          {/* Feature Cards */}
          <div className="grid md:grid-cols-2 gap-8 mb-24" id="features">
            {features.map((feature, index) => (
              <Link 
                key={index}
                to={feature.path}
                className={`${feature.color} p-6 rounded-xl transition-all duration-200 transform hover:-translate-y-1`}
              >
                <div className="flex flex-col items-center">
                  {feature.icon}
                  <h3 className="mt-4 text-lg font-medium text-gray-900">{feature.title}</h3>
                  <p className="mt-2 text-gray-600 text-center text-sm">{feature.description}</p>
                </div>
              </Link>
            ))}
          </div>

          {/* Role Selection */}
          <div className="py-10" id="roles">
            <h2 className="text-xl font-medium text-gray-900 mb-8">System Access</h2>
            <div className="flex justify-center space-x-10">
              {roles.map((role, index) => (
                <Link
                  key={index}
                  to={role.path}
                  className="group transition-all duration-200 flex flex-col items-center transform hover:-translate-y-1"
                >
                  <div className={`w-16 h-16 rounded-full ${role.color} flex items-center justify-center shadow-sm transition-all duration-200`}>
                    {role.icon}
                  </div>
                  <h3 className="mt-3 text-sm font-medium text-gray-800 group-hover:text-gray-900">{role.title}</h3>
                </Link>
              ))}
            </div>
          </div>
        </section>
      </main>

      <footer className="py-8 mt-16 border-t border-gray-100">
        <div className="max-w-5xl mx-auto px-6 text-center text-gray-500 text-sm">
          Â© 2025 Vership. All rights reserved.
        </div>
      </footer>
    </div>
  );
}

export default HomePage;
